Sometimes we want to emulate the following common pattern from OO languages such as Java: class Foo { void m() { ... }
} class Bar extends Foo {} public static void main(String[] args) { Bar b = new Bar(); b.m();
} We can use the deref polymorphism anti-pattern to do so: struct Foo {} impl Foo { fn m(&self) { ... }
} struct Bar { f: Foo
} impl Deref for Bar { type Target = Foo; fn deref(&self) -> &Foo { &self.f }
} fn main() { let b = Bar { Foo {} }; b.m();
} There is no struct inheritance in Rust. Instead we use composition and include an instance of Foo in Bar (since the field is a value, it is stored inline, so if there were fields, they would have the same layout in memory as the Java version (probably, you should use #[repr(C)] if you want to be sure)). In order to make the method call work we implement Deref for Bar with Foo as the target (returning the embedded Foo field). That means that when we dereference a Bar (for example, using *) then we will get a Foo. That is pretty weird. Dereferencing usually gives a T from a reference to T, here we have two unrelated types. However, since the dot operator does implicit dereferencing, it means that the method call will search for methods on Foo as well as Bar.

